select ptno_num as [Account Number]
, '' as [date of service]
, Pt_Name as [Name]
, case
	when LEFT(ptno_Num, 1) = '1'
		then 'IP'
		else 'OP'
  end as [IP/OP]
, Pt_Zip_Cd as [Zip Code]
, ''
, '' as [dna]
, User_Pyr1_Cat
, case
	when User_Pyr1_Cat = 'MIS'
		then 'UNINSURED'
		else 'INSURED'
  end as [Insured / Uninsured]
, a.Adm_Date
, a.Dsch_Date
, DATEPART(year, a.Dsch_Date) as discharge_yr
, a.fc
, '' as [date_cc_app_sent]
, '' as [applied]
, '' as [date cc returned]
, '' as [year cc returned]
, '' as [family size]
, a.hosp_svc
, ''
, ''
, ''
, ''
, ''
, ''
, ''
, ''
, case 
	when b.cr_rating in ('l', 'e') then '100'
	when b.cr_rating in ('m', 'f') then '90'
	when b.cr_rating in ('n', 'g') then '80'
	when b.cr_rating in ('o', 'h') then '45'
	when b.cr_rating IN ('p', 'i') then '25'
	when b.cr_rating in ('q', 'j') then '10'
	when b.cr_rating = 'k' then '0'
  end as [cc % approved]
, a.tot_chg_amt
, '' as amt_of_charity
, b.pt_bal_amt as [pt_resp]
, '2016'
, ''
, 'Presumptive Charity'
, 'Presump'

from smsdss.BMH_PLM_PtAcct_V as a
left join smsmir.acct as b
on a.pt_no = b.pt_id
	and a.unit_seq_no = b.unit_seq_no

